import React from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import App from "./components/Home/App";

const AppRouter = () => {
    return (
     <BrowserRouter>
      <div>
      <Routes>
        <Route path="/welcome" element={<App />} />
       </Routes>
      </div>
     </BrowserRouter>
    );
   };


   export default AppRouter;
